import React from 'react';
import LaunderingImage from "../../assets/Laundering.jfif";
import IroningImage from '../../assets/Ironing.jfif';
import NavBar from '../../components/NavBar';

const Home = () => {
   
        return (
            <div>
                 <NavBar/>
        <div className="container mx-auto px-4">
            <h1 className="text-3xl font-bold mt-8 mb-4">Welcome to Our Website</h1>
            <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
                <img src={LaunderingImage} alt="Laundering" className="max-w-full h-auto" />
                <img src={IroningImage} alt="Ironing" className="max-w-full h-auto" />
            </div>
        </div>
        <div>footer</div>
        </div>
    );
};

export default Home;
